    27, 2010.  We incorrectly reported the contribution to Cunningham for U.S. Senate
    on 5/07/10 as being for the General Election, when it should have been for the
    Runoff Election.    Likewise, we incorrectly reported the contribution to Hanabusa
    2010 on 4/26/10 as being for the Primary Election when it should have been for
